agocms.feature_layer.config.search:
  path: '/admin/agocms/feature_layer/config/search'
  defaults:
    _controller: '\Drupal\agocms\Controller\AgocmsFeatureLayerController::configSearch'
    _format: json
  requirements:
    _permission: 'access content'
agocms.token.update:
    path: '/agocms/token/update'
    defaults:
      _controller: '\Drupal\agocms\Controller\AgocmsTokenController::update'
      _format: json
    requirements:
      _permission: 'access content'
